/* From Uiverse.io by ahmed150up - Tags: save, btn */
.btn-save {
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px 20px;
  border: none;
  border-radius: 4px;
  background-color: #f2f2f2;
  color: #333;
  font-size: 16px;
  font-weight: bold;
  cursor: pointer;
  transition: background-color 0.3s ease;
}

.btn-save:hover {
  background-color: #ddd;
}

.icon {
  width: 24px;
  height: 24px;
  margin-right: 8px;
}

.icon-path {
  fill: #333;
  transition: fill 0.3s ease;
}

.btn-save:hover .icon-path {
  fill: #888;
}

